public class InnerUserPoolSchemaAttributeFactory(Action<Humidifier.Cognito.UserPoolTypes.SchemaAttribute> factoryAction = null) : SubResourceFactory<Humidifier.Cognito.UserPoolTypes.SchemaAttribute>
{

    internal InnerUserPoolStringAttributeConstraintsFactory StringAttributeConstraintsFactory { get; set; }

    internal InnerUserPoolNumberAttributeConstraintsFactory NumberAttributeConstraintsFactory { get; set; }

    protected override Humidifier.Cognito.UserPoolTypes.SchemaAttribute Create()
    {
        var schemaAttributeResult = CreateSchemaAttribute();
        factoryAction?.Invoke(schemaAttributeResult);

        return schemaAttributeResult;
    }

    private Humidifier.Cognito.UserPoolTypes.SchemaAttribute CreateSchemaAttribute()
    {
        var schemaAttributeResult = new Humidifier.Cognito.UserPoolTypes.SchemaAttribute();

        return schemaAttributeResult;
    }
    public override void CreateChildren(Humidifier.Cognito.UserPoolTypes.SchemaAttribute result)
    {
        base.CreateChildren(result);

        result.StringAttributeConstraints ??= StringAttributeConstraintsFactory?.Build();
        result.NumberAttributeConstraints ??= NumberAttributeConstraintsFactory?.Build();
    }

} // End Of Class

